import './App.css';
import { Route, Link} from 'react-router-dom';
import Friends from './pages/Friends';
import Home from './pages/Home';

function App() {
  return (
    <div >

      <Navbar />
      <Sidebar />

      <Route exact path="/" component={Home} />
      <Route exact path="/Friends" component={Friends} />


    </div>

  );
}

export default App;
